import React from 'react';

class Result extends React.Component {

    state = {
        children: ''
    }

    openResultHandler = (value) => {
        this.setState({
            children: 'O valor da sua hora é R$' + value.toFixed(2),
            className: 'open-result'
        });
    }

    closeResultHandler = () => {
        this.setState({
            children: ''
        })
    }

    render(){
        return (
            <div className="close-result">

            </div>
        );
    }
}

export default Result;
